  false,\n\t\"url\": null,\n\t\"notes\": \"WELL LOG DATA FOR SERVICE NEEDS TO GO INTO
  THE WELL LOG CONTENT MODEL (see http://repository.stategeothermaldata.org/repository/resource/98ddf901b9782a25982e01af3b05b445/
  ). This workbook is designed as a guideline for compiling information from well
  log headers. Information compiled in this workbook can be used to populate the Well
  Header data delivery template, Borehole Temperature template and to populate Metadata
  records for well log documents.  Basic information from the header is used to create
  Well Header features used to index borehole locations with the information associated
  with the borehole. Typically maximum temperatures are recorded from log headers,
  and reported as'bottom hole temperature'using the  borehole temperature observation
  service. Each row in the WellLogInformation sheet in this workbook will correspond
  to an individual log from a borehole; thus there may be multiple rows per well.
  For logs that are scanned or digitized and availble as online resources, metadata
  records will be created. The HeaderURI for a particular borehole (well for simple
  wells) is the cross-referencing link (foreign key) used to associate the header
  record, well log metadata, temperature measurements, and other information from
  a particular borehole.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
